export default function Todo(props) {
    const {todo} = props;
    return (
        <div key={todo._id} className="todo">
            <p>{todo.todo}</p>
            <div>
                <button className="todo__status">
                    {(todo.status) ? "☑" : "☐"}
                </button>
            </div>
        </div>
    )
}
